import React from "react";

export const CheckMark = () => {
  return (
    <div>
      <h1>Finish</h1>
      <style jsx>{`
        h1 {
          font-size: 45px;
          color: white;
        }
      `}</style>
    </div>
  );
};

export const Close = () => {
  return (
    <div>
      <h1>Start</h1>
      <style jsx>{`
        h1 {
          font-size: 45px;
          transition: all 0.8s ease;
        }
      `}</style>
    </div>
  );
};
